DROP TRIGGER IF EXISTS ` add_student`;
DELIMITER ;;
CREATE TRIGGER ` add_student` AFTER INSERT ON `sooncode_student` FOR EACH ROW begin
DECLARE c int;
set c = (select student_number from clazz where clazz_id=new.clazz_id);
update clazz set student_number = c + 1 where clazz_id = new.clazz_id;
end
;;
DELIMITER ;
DROP TRIGGER IF EXISTS `TOTAL_TRIGGER`;
DELIMITER ;;
CREATE TRIGGER `TOTAL_TRIGGER` BEFORE UPDATE ON `student_total` FOR EACH ROW BEGIN 

SET NEW.TOTAL = NEW.MATH + NEW.CHINESE;

END
;;
DELIMITER ;
